import React from "react";

const Header = props => {
  return (
    <div>
      <nav class="navbar navbar-expand-lg navbar-light bg-danger">
        <a class="navbar-brand ml-5 font-weight-bold" href="#">
          Contact Manager
        </a>
        <ul>
          <li className="nav-item">Home</li>
        </ul>
      </nav>
    </div>
  );
};

export default Header;
